import base64
from io import BytesIO
from PIL import Image
import numpy as np
from PyQt5 import QtGui, QtCore


def b64toImage(b64_str):
    img_b64 = BytesIO(base64.b64decode(b64_str))
    return Image.open(img_b64).convert('RGBA')


img_pack = {
    "nofile": b64toImage(
        b""),
    "down_arrow": b64toImage(
        b""),
    "icon16": b64toImage(
        b""),
    "icon24": b64toImage(
        b""),
    "icon32": b64toImage(
        b""),
    "icon48": b64toImage(
        b""),
    "icon128": b64toImage(
        b""),
    "icon256": b64toImage(
        b""),
    "about_logo": b64toImage(
        b""),
    # "Template":b64toImage(b""),
}


def pil2qt(img):
    narr = np.asarray(img)
    if len(narr.shape) == 3:
        if narr.shape[2] == 4:
            qformat = QtGui.QImage.Format_RGBA8888
        else:
            qformat = QtGui.QImage.Format_RGB888
        img = QtGui.QImage(narr.data, narr.shape[1], narr.shape[0], narr.strides[0], qformat)
    return QtGui.QPixmap.fromImage(img)


def setWindowIcons(window):
    wd_icon = QtGui.QIcon()
    wd_icon.addPixmap(pil2qt(img_pack["icon16"]), QtGui.QIcon.Selected, QtGui.QIcon.On)
    wd_icon.addPixmap(pil2qt(img_pack["icon24"]), QtGui.QIcon.Selected, QtGui.QIcon.On)
    wd_icon.addPixmap(pil2qt(img_pack["icon32"]), QtGui.QIcon.Selected, QtGui.QIcon.On)
    wd_icon.addPixmap(pil2qt(img_pack["icon48"]), QtGui.QIcon.Selected, QtGui.QIcon.On)
    wd_icon.addPixmap(pil2qt(img_pack["icon128"]), QtGui.QIcon.Selected, QtGui.QIcon.On)
    wd_icon.addPixmap(pil2qt(img_pack["icon256"]), QtGui.QIcon.Selected, QtGui.QIcon.On)
    window.setWindowIcon(wd_icon)
